    <header className="header">
      <img className="logo" src={logo} alt="Логотип сайта mesto" />
      <nav className="header__auth">
        <p className="header__text">{email}</p>
        <Link
          to={route}
          className="header__link link-opacity"
          type="button"
          onClick={onClick}
        >
          {title}
        </Link>
      </nav>
    </header>
  );
}

export default Header;
